import React from 'react';
import BoardMembers from '../components/boardMembers';

const Board = () => {
  return (
    <section className="board-members">
      <h2>Meet The Board</h2>
      <div className="members-grid">
        <BoardMembers />
      </div>
    </section>
  );
};

export default Board;
